.data-labels {
  font-size: 12px;
  text-anchor: middle;
  font-family: helvetica, arial, sans-serif;
  pointer-events: none;
}
p {
  font-size: 20px;
  font-weight: bold;
}
p em {
  background: yellow;
  padding: 5px;
}
.node {
  fill: #fff;
}
.textBody {
  font-weight: bold;
}
.zoomSlider {
  position: absolute;
  top: 0px;
}
.link-active {
  stroke: black;
  stroke-width: 10px;
}
.node-active {
  stroke-width: 5px;
}


